import React, { useEffect, useState } from 'react';
import { getDistance } from 'geolib';
import axios from 'axios';
import './App.css';

const Route = props => {

    useEffect(() => {
        axios.get(`${process.env.REACT_APP_ROUTE_API}/jPath${props.start}${props.end}?api_key=${process.env.REACT_APP_SECRET}`)
          .then((data) => console.log(data))
      }, [])


    return(
        <div>this will be the route guide</div>
    )

}

export default Route;
